import React from "react";
import { Link, useLocation } from "react-router-dom";
import { connect } from "react-redux";
import ReactTooltip from "react-tooltip";
// Img
import clipped from "../../assets/img/unClipped.png";
import { modalOpen } from "../../store/actions/Index";

const LoggedOutNav = props => {
  let location = useLocation();
  return (
    <div onClick={() => modalOpen()}>
      <Link
        data-tip
        data-for="clipTip"
        to={{ pathname: "/auth", state: { background: location } }}
        className="loginText"
      >
        <img src={clipped} alt="" className="clippedHeartLoggedOut" />
        <ReactTooltip
          id="clipTip"
          place="bottom"
          effect="solid"
          delayHide={100}
          delayShow={300}
          border
          multiline={false}
        >
          Clip your favorites.
        </ReactTooltip>
      </Link>
    </div>
  );
};

export default connect(
  null,
  { modalOpen }
)(LoggedOutNav);
